import { createStructuredSelector } from 'reselect';
import { IPokerHomepageContainerProps, IPokerHomepageContainerState } from '../../shared';

export function createPokerHomepageSelector<any, any>(property: string) {
  return(state: IPokerHomepageContainerState) => {
    return state[property];
  }
}

export function createStructuredSelector<S, T>(
  selectors: {[K in keyof T]: Selector<S, T[K]>},
  selectorCreator?: typeof createSelector,
): Selector<S, T>;

export const pokerHomepageSelector = createStructuredSelector({
  clientId: createPokerHomepageSelector('clientId'),
  clientName: createPokerHomepageSelector('clientName')
});
